import React from "react";
import "./Styles/Pages.css";

const Home = () => {
  return (
    <div id="Home">
      <head>
        <title>NIF</title>
      </head>
      <div className="title">
        <h1>Welcome to My Portfolio</h1>
      </div>
      <div>
        <h3>
          My name is Faris Ilham Noormandiri.<br/>
          I am a third-year college student majoring in Computer Science.
        </h3>
      </div>
    </div>
  );
};

export default Home;
